import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Box from '@material-ui/core/Box';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import UploadButton from './uploadbutton_ver2';
import Divider from '@material-ui/core/Divider';
import ResultTable from '../main_ver2/resulttable_ver2';
import FileList from '../main/filelist';
import KPMGlogo from '../../static/KPMG_logo_white.svg';


const useStyles = makeStyles((theme) => ({
    root: {
        textAlign: 'center',
        height: '100%',
        width: '100%',
    },
    titleContainer: {
        color: 'white',
        paddingTop: theme.spacing(5),
        paddingBottom: theme.spacing(3),
    },
    uploadContainer: {
    },
    dataContainer: {
        backgroundColor: 'rgba(107, 186, 167, 0.5)',
    },
    dataTable: {
        display: 'flex',
        flexDirection: 'row',
    },
    divider: {
        marginLeft: "10%",
        marginRight: "10%",
        backgroundColor: '#f5f5f5',
    },

    container: {
        padding: 0,
    },
    grid: {
        // border:'solid red',
    }
}));



export default function Main() {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <div className={classes.titleContainer}>
                <Container maxWidth="lg" className={classes.container}>
                    <Grid container direction="row" justify="center" alignItems="center" >
                        <Grid item> <a href="/"><img src={KPMGlogo} alt="KPMG_logo" width='150px' /></a></Grid>
                        <Divider orientation="vertical" flexItem className={classes.divider} color='secondary.light' />
                        <Grid item><div style={{ fontSize: '55px' }}>Libor</div></Grid>
                        <Divider orientation="vertical" flexItem className={classes.divider} color='secondary.light' />
                        <Grid item> <div style={{ fontSize: '55px' }}>Logo</div></Grid>
                    </Grid>
                </Container>
            </div>

            <div className={classes.dataContainer}>
                <Container maxWidth="lg" className={classes.container}>
                <Box height={670} className={classes.box}>
                    <Grid container direction="row" justify="center" alignItems="stretch" className={classes.grid}>


                        <Grid item xs={4}><Box height={670} className={classes.box}>
                            <FileList />
                        </Box></Grid>
                        <Grid item xs={7}><Box height={670} className={classes.box}>
                            <ResultTable />
                        </Box></Grid>

                    </Grid>
                    </Box>
                </Container>
            </div>

            <div className={classes.uploadContainer}>
                <Container maxWidth="lg" className={classes.container}><UploadButton /></Container>
            </div>
        </div>
    );
}
